import React from "react";

function Card(props) {
    return (
    <div className= "card-container" >
     <img src={props.imageUrl} alt="random image" />
     <h1>{props.primaryText}</h1>
     <h2>{props.secondaryText}</h2>

    </div>
    );
    }
    export default Card;
